  \"2016-03-31T23:55:08.382794\",\n\t\"name\": \"enviroatlas-atmospheric-nitrogen-deposition-by-12-digit-huc-for-the-conterminous-united-s-2006\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas dataset includes annual
  nitrogen and sulfur deposition within each 12-digit HUC subwatershed for the year
  2006. Values are provided for total oxidized nitrogen (HNO3, NO, NO2, N2O5, NH3,
  HONO, PAN, organic nitrogen, and particulate NO3), oxidized nitrogen wet deposition,
  oxidized nitrogen dry deposition, total reduced nitrogen (NH3 and particulate NH4),
  reduced nitrogen dry deposition, reduced nitrogen wet deposition, total dry nitrogen
  deposition, total wet nitrogen deposition, total nitrogen deposition (wet+dry),
  total sulfur (SO2 + particulate SO4) dry deposition, total sulfur wet deposition,
  and total sulfur deposition. The dataset is based on output from the Community Multiscale
  Air Quality modeling system (CMAQ) run using the bidirectional flux option for the
  12-km grid size for the US, Canada, and Mexico. The CMAQ output has been post-processed
  to adjust the wet deposition for errors in the location and amount of precipitation
  and for regional biases in the TNO3 (HNO3 + NO3), NHx (NH4 + NH3), and sulfate wet
  deposition. Model predicted values of dry deposition were not adjusted. This dataset
  was produced by the US EPA to support research and online mapping activities related
  to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to
  interact with a web-based, easy-to-use, mapping application to view and analyze
  multiple ecosystem services for the contiguous United States. The dataset is available
  as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an
  EnviroAtlas map service. Additional descriptive information about each attribute
  in this dataset can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
